import React from "react";
import NewsBlock from "./newsBlock.js";

const Latest1 = ({ data }) => {
  return (
    <div className="sections1">
      {data.latest.map((news, index) => (
        <>
          <NewsBlock news={news} displayDesc={false} key={index0}></NewsBlock>
        </>
      ))}
    </div>
  )
}

export default Latest1;
